import useFetch from "../useFetch";
import AllCard from "./allCard";

const Home = () => {
  const { data: products } = useFetch("http://127.0.0.1:8000/api/product");
  return (
    <div>
      {
        products && <AllCard /> 
        }
    </div>
  );
};
export default Home;
